        \   \n    \n    \n\n    \n    \n    \n<p class=\"fig-standfirst\"\n            \n
        \           >Le quadra, \xE0 la t\xEAte du DataLab, a cr\xE9\xE9 Albert, l\u2019IA
        g\xE9n\xE9rative souveraine \xE0 la fran\xE7aise, qui permet \xE0 l\u2019\xC9tat
        d\u2019\xEAtre plus rapide dans sa relation avec les citoyens.</p>\n\n                    \n<div\n
        \   class=\"fig-content-body\"\n    data-agora-connect-urls=\"&#x7B;&quot;baseUrl&quot;&#x3A;&quot;https&#x3A;&#x5C;&#x2F;&#x5C;&#x2F;connect.lefigaro.fr&quot;&#x7D;\"\n
        \   data-component=\"fig-content-body\"\n    data-context=\"was @visible\"\n
        \   data-id=\"bGVmaWdhcm8uZnJfXzE4NDdhYzdjLTAwYTYtMTFlZi04Mjk0LWEwMzY5ZjZmN2JjOF9fQXJ0aWNsZQ==\"\n
        \   data-module=\"fig-body\"\n    data-premium=\"true\"\n>\n                                                                \n<p
        class=\"fig-paragraph\"><em>\xAB</em> <em>Nous aussi, nous savons attirer
        les meilleurs</em> <em>!</em> <em>\xBB</em> \xC0 Matignon, on n\u2019est pas
        peu fier de l\u2019embauche par l\u2019\xC9tat, il y a un an, d\u2019Ulrich
        Tan, un jeune quadra g\xE9nie du num\xE9rique. C\u2019est en effet \xE0 cet
        ing\xE9nieur, issu du corps des Mines, form\xE9 \xE0 Polytechnique et Sciences
        Po, que l\u2019\xC9tat a confi\xE9 le soin d\u2019introduire <a href=\"http://www.lefigaro.fr/secteur/high-tech/dossier/intelligence-artificielle-la-nouvelle-revolution\"
        data-fig-type=\"Topic\" data-gtm-custom-categorie=\"navigation\" data-gtm-custom-action=\"crossclick\"
        data-gtm-custom-label=\"Contextuel\" data-gtm-event=\"customEventSPE\" data-fig-domain=\"LEFIGARO\">l\u2019intelligence
        artificielle</a> \xE0 diff\xE9rents \xE9tages de l\u2019administration. Et
        ce, pour la rendre plus efficace et plus rapide, \xE0 la fois pour les fonctionnaires
        et les citoyens.<em> \xAB</em> <em>Il nous faut \xEAtre visionnaire pour mettre
        l\u2019IA au service des Fran\xE7ais</em> <em>\xBB</em>, estime <a href=\"http://www.lefigaro.fr/politique/violences-des-jeunes-baisse-d-impots-europeennes-ce-qu-il-faut-retenir-de-l-emission-de-gabriel-attal-sur-bfmtv-20240418\"
        data-fig-type=\"NewsFlash\" data-gtm-custom-categorie=\"navigation\" data-gtm-custom-action=\"crossclick\"
        data-gtm-custom-label=\"Contextuel\" data-gtm-event=\"customEventSPE\" data-fig-domain=\"LEFIGARO\">Gabriel
        Attal</a>.</p>\n\n                                                                                            \n
        \   \n    \n<p class=\"fig-paragraph\">Ulrich Tan est chef du DataLab au d\xE9partement
        Etalab de la Direction interminist\xE9rielle du num\xE9rique (Dinum). C\u2019est
        apr\xE8s avoir travaill\xE9 neuf ans dans le priv\xE9 (chez un \xE9quipementier
        industriel, dans un groupe bancaire comme responsable data sciences, et entrepreneur
        dans le domaine de la s\xE9curit\xE9 et l\u2019IA) que celui qui se dit <em>\xAB</em>
        <em>tr\xE8s attach\xE9</em> <em>\xBB</em> \xE0 son corps d\u2019origine d\xE9cide
        de reprendre le chemin de l\u2019administration\u2026</p>\n\n\n\n    \n<div
